class TypeUtil{static getJavaType(e){let i=e.toLowerCase();if(-1!==i.indexOf("int")&&-1==i.indexOf("tinyint"))return"Long";if(-1!==i.indexOf("boolean")||-1!==i.indexOf("tinyint"))return"Boolean";if(-1!==i.indexOf("longtext"));else if(-1!==i.indexOf("long")||-1!==i.indexOf("bigint"))return"Long";else if(-1!==i.indexOf("string")||-1!==i.indexOf("varchar")||-1!==i.indexOf("text"));else if(-1!==i.indexOf("date")||-1!==i.indexOf("timestamp"))return"Date";else if(-1!==i.indexOf("double")||-1!==i.indexOf("float"))return"Double";else if(-1!==i.indexOf("uuid"))return"UUID";else if(-1!==i.indexOf("bigdecimal"))return"BigDecimal";else if(-1!==i.indexOf("number")||-1!==i.indexOf("real")||-1!==i.indexOf("decimal")||-1!==i.indexOf("numeric"))return"Double";return"String"}}